@dazzadooby @LBC @NIAbbot It really won't bother us. What will bother us is the constant ww2 references and the attempts to link brexit to the team's success.

But there's no reason we should support England. Just as there's no reason England should should support Germany.

BTW we admire the team itself.

As a Scotland fan I admire the current England team and the leadership of Gareth Southgate.

However England are our biggest rivals, as Germany are yours, so I have to support Italy.

An England win may help the economy short term but but not much longer.
